<H1><A NAME="lnk4077"></A><SUP></SUP>Linker Tools Warning LNK4077</H1>

<P class=dt><B>exports file "filename" used; ignoring other export specifications</B></P>

<P>The given exports file provides the program's exports. Exports specified by the /EXPORT option or the <A HREF="_core_exports.htm">EXPORTS</A> statement in a .DEF file were ignored.</P>
